<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Main</title>
  <link rel="stylesheet" href="./styles/style.css">
  <link rel="stylesheet" href="./styles/codicons/codicon.css">
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link
    href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&display=swap"
    rel="stylesheet">
  <link rel="stylesheet" href="./styles/themes/light.css">
</head>

<body>
  <div class="dialog-container" id="dialog-container" style="display: none;">
    <div class="dialog">
      <div class="header">
        <span class="title">Choose a report to copy</span>
        <button id="close-dialog">Close</button>
      </div>
      <div class="body">
        <select name="choose-report-select" id="choose-report-select">
          <option value="0">Meeting report</option>
          <option value="1">Weekly report</option>
        </select>
      </div>
      <div class="footer">
        <button id="dialog-cancel">Cancel</button>
        <button id="dialog-select">Select</button>
      </div>
    </div>
  </div>
  <div class="title-bar">
    <div class="information-container">
      <span id="window-title" class="title">4Blocker</span>
    </div>
    <div class="window-controls">
      <button id="titlebar-minimize-button" class="control codicon codicon-chrome-minimize"></button>
      <button id="titlebar-maximize-button" class="control codicon codicon-chrome-maximize"></button>
      <button id="titlebar-close-button" data-type="close" class="control codicon codicon-chrome-close"></button>
    </div>
  </div>

  <button class="fab-menu" id="fab-menu">
    <span class="icon menu"></span>
  </button>
  <div class="menu-container" id="menu-container">
    <button class="menu-item" style="--index: 0" id="reload-button">
      <span class="icon reload"></span>
      <span class="tooltip">Rerun</span>
    </button>
    <button class="menu-item" style="--index: 1" id="zoom-in-button">
      <span class="icon zoom_in"></span>
      <span class="tooltip">Zoom in</span>
    </button>
    <button class="menu-item" style="--index: 2" id="zoom-out-button">
      <span class="icon zoom_out"></span>
      <span class="tooltip">Zoom out</span>
    </button>
    <button class="menu-item" style="--index: 3" id="zoom-reset-button">
      <span class="icon zoom_reset"></span>
      <span class="tooltip">Reset zoom</span>
    </button>
    <button class="menu-item" style="--index: 4" id="information-collapse-button">
      <span class="icon collapse"></span>
      <span class="tooltip">Collapse</span>
    </button>
    <button class="menu-item" style="--index: 5" id="information-expand-button">
      <span class="icon expand"></span>
      <span class="tooltip">Expand</span>
    </button>
    <button class="menu-item" style="--index: 6" id="toggle-last-week-column">
      <span class="icon toggle"></span>
      <span class="tooltip">Toggle Last Week column</span>
    </button>
    <!-- <button class="menu-item" style="--index: 7" id="reduce-width-button">
      <span class="icon width"></span>
      <span class="tooltip">Reduce width</span>
    </button> -->
    <button class="menu-item" style="--index: 8" id="settings-button">
      <span class="icon settings"></span>
      <span class="tooltip">Settings</span>
    </button>
    <button class="menu-item" style="--index: 9" id="help-button">
      <span class="icon help"></span>
      <span class="tooltip">Help</span>
    </button>
  </div>

  <div class="main-container" id="main-container">
    <div class="blocker">
      <span id="blocker-title" class="title"></span>
      <div class="header">
        <div class="status-label">Status</div>
        <div id="blocker-status" class="status"></div>
        <div class="progress-label">Progress</div>
        <div class="progress">
          <div id="blocker-progress-bar" class="progress-bar">
            <span></span>
            <div class="progress-background"></div>
          </div>
        </div>
      </div>
      <div class="body">
        <div class="section">
          <span class="section-title">Accomplishments</span>
          <div class="section-body" id="blocker-acc">
          </div>
        </div>
        <div class="section">
          <span class="section-title">Risks</span>
          <div class="section-body" id="blocker-risks"></div>
        </div>
        <div class="section">
          <span class="section-title">Remarks</span>
          <div class="section-body" id="blocker-remarks"></div>
        </div>
        <div class="section">
          <span class="section-title">On Hold</span>
          <div class="section-body" id="blocker-onhold"></div>
        </div>
      </div>
    </div>
    <button class="copy-button" id="copy-report">
      <svg xmlns="http://www.w3.org/2000/svg" height="24" viewBox="0 -960 960 960" width="24">
        <path
          d="M760-200H320q-33 0-56.5-23.5T240-280v-560q0-33 23.5-56.5T320-920h280l240 240v400q0 33-23.5 56.5T760-200ZM560-640v-200H320v560h440v-360H560ZM160-40q-33 0-56.5-23.5T80-120v-560h80v560h440v80H160Zm160-800v200-200 560-560Z" />
      </svg>
    </button>

    <div class="report" id="report-container">
      <div class="header">
        <span id="report-title" class="title"></span>
        <div style="display: flex;">
          <div class="target-date" id="target-date"></div>
          <div id="report-status-container" class="status-container"></div>
          <div class="progress-container">
            <div id="report-progress-bar" class="progress-bar on-track">
              <span></span>
              <div class="progress-background"></div>
            </div>
          </div>
        </div>
      </div>
      <div id="accomplishments-information" class="information">
        <div>
          <span id="accomplishments-week"></span>
          <!-- <button class="collapse" id="collapse-accomplishments">Collapse</button> -->
        </div>
        <textarea name="" id="report-acc-textarea" rows="4"></textarea>
      </div>
      <div id="risks-information" class="information">
        <div>
          <span>Risks</span>
          <!-- <button class="collapse" id="collapse-risks">Collapse</button> -->
        </div>
        <textarea name="" id="report-risks-textarea" rows="4"></textarea>
      </div>
      <table id="report-table" class="milestone-container">
        <thead>
          <tr>
            <th>Milestones</th>
            <th>Start date</th>
            <th>Finish date</th>
            <th>New Finish Date</th>
            <th>Actual date</th>
            <th>Target</th>
            <th>Remaining</th>
            <th>Progress</th>
            <th class="invisible">Last Week Progress</th>
          </tr>
        </thead>
        <tbody id="report-body">
        </tbody>
      </table>
    </div>
  </div>
